import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes.js";


function createnotes(contact) {
    return (
      <Card
        key={contact.id}
        name={contact.name}
        img={contact.imgURL}
        tel={contact.phone}
        email={contact.email}
      />
    );
  }




function App() {
    return (<div>
    <Header />
    {notes.map(createnote)}
    <Footer />
    </div>);}


export default App;
